import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MainLayout from './components/MainLayout'; // Path to your MainLayout component
import DatabaseTables from './pages/DatabaseTables'; // Path to DatabaseTables component
import HomePage from './pages/HomePage'; // Example for home page or other routes

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<MainLayout />}>
                    {/* Define routes inside MainLayout */}
                    <Route path="/" element={<HomePage />} /> {/* Home route */}
                    <Route path="/database" element={<DatabaseTables />} /> {/* DatabaseTables route */}
                </Route>
            </Routes>
        </Router>
    );
};

export default App;
